INSERT INTO `AspectText` (`TextType`, `Planet1`, `Planet2`, `Planet1num`, `Planet2num`, `Aspect`, `Aspectnum`, `Text`, `Lang`) VALUES ("TRANSASP","JUPITER","SATURN",6,7,"CONJUNCT",0,"       You are industrious with a serious minded attitude. You are purposeful, concerned with long term goals during this aspect. Combine growth with wise management. Be careful how you grow. Consider your own personal philosophy and try to honor it when possible. Your past actions can bring fruit right now. 
","English"), ("TRANSASP","JUPITER","SATURN",6,7,"TRINE",2,"       This is a good transit for furthering work at long term goals. You can use this transit for furthering higher education and your professional career. You will need to be honest in business and balance optimism and caution at this time. This is a good time for friendships with mature individuals.
","English"), ("TRANSASP","JUPITER","SATURN",6,7,"SQUARED",4,"       This transit gives you problems with your legal and business professional problems. Beware of timing on changes. It is not a good time to initiate changes. You may have conflicts between your professional and family  responsibilities. Beware of ethical conflicts.
","English"), ("TRANSASP","JUPITER","SATURN",6,7,"SEXTILE",1,"       This is a good transit for furthering work at long term goals. You can use this transit for furthering higher education and your professional career. You will need to be honest in business and balance optimism and caution at this time. This is a good time for friendships with mature individuals.
","English"), ("TRANSASP","JUPITER","SATURN",6,7,"OPPOSITION",3,"       This transit causes poor timing in business, professional, and domestic affairs. Your tactics may be questionable. This suggests legal difficulties and lawsuits. This is a bad time for expansion. Learn to be more conservative right now.
","English"), ("TRANSASP","JUPITER","URANUS",6,8,"CONJUNCT",0,"       You are tolerant of many different attitudes and points of view right now.  You may have sudden financial gain right now. You are able to access your latent psychic abilities right now. This is a good time to travel and pursue higher level education right now. You have strong humanitarian desires right now, use them.
","English"), ("TRANSASP","JUPITER","URANUS",6,8,"TRINE",2,"       This transit expands your awareness, making you more intuitive and gives you a broad minded humanitarian attitude. This gives you an optimistic attitude toward life and new adventure. This is a good time for associations with religion, education, cultural groups and organizations and dealing with the occult.
","English"), ("TRANSASP","JUPITER","URANUS",6,8,"SQUARED",4,"       This transit causes you to be too optimistic, impatient, disorganized, undisciplined, impractical, and lack common sense. Be careful not to jump to conclusions and take to much for granted. Watch your desire for freedom and travel which are not useful. Beware of difficulties with travel and foreigners.
       You may become involved with extreme religious characters or have problems with lawsuits and get rich schemes. You stand to lose big.
","English"), ("TRANSASP","JUPITER","URANUS",6,8,"SEXTILE",1,"       This transit expands your awareness, making you more intuitive and gives you a broad minded humanitarian attitude. This gives you an optimistic attitude toward life and new adventure. This is a good time for associations with religion, education, cultural groups and organizations and dealing with the occult.
","English"), ("TRANSASP","JUPITER","URANUS",6,8,"OPPOSITION",3,"       This transit causes you to be impractical and lack discipline, and make promises you cannot keep. You tend to be undisciplined, insincere and dishonest. You make promises to groups and friends that will be difficult to fulfill. Beware of cults and dubious spiritual leaders. Beware of get rich quick schemes. Your friends may be well-meaning but unreliable and eccentric.
","English"), ("TRANSASP","JUPITER","NEPTUNE",6,9,"CONJUNCT",0,"       You have an increased spiritual awareness right now. Expand your spiritual awareness and use it for your better good. Spread it out and do some good with it. Help mankind with your good will. Beware to balance your idealism and passion with mental objectivity and practicality.
","English"), ("TRANSASP","JUPITER","NEPTUNE",6,9,"TRINE",2,"       This is a transit that increases your spiritual awareness and increases your faith. This is a good time to be involved with mystical and spiritual groups. This is a good time for work with hospitals, institutions, or spiritual retreats. This transit also increases your humanitarian  feelings and idealism.
","English"), ("TRANSASP","JUPITER","NEPTUNE",6,9,"SQUARED",4,"       This transit causes you to daydream impractical dreams. Watch your tendencies to have unrealistic expectations and misplaced sympathies. Watch out for extreme religious characters and charlatans. Beware of cults and gurus. Beware of get rich quick schemes. You are very susceptible at this time.
","English"), ("TRANSASP","JUPITER","NEPTUNE",6,9,"SEXTILE",1,"       This is a transit that increases your spiritual awareness and increases your faith. This is a good time to be involved with mystical and spiritual groups. This is a good time for work with hospitals, institutions, or spiritual retreats. This transit also increases your humanitarian  feelings and idealism.
","English"), ("TRANSASP","JUPITER","NEPTUNE",6,9,"OPPOSITION",3,"       Your idealism with respect to religion and spirituality is impractical and will lead you to be involved with spiritual cults. You may have false humility and inflate your own importance. You may succumb to sob stories and get rich quick schemes.
","English"), ("TRANSASP","JUPITER","PLUTO",6,10,"CONJUNCT",0,"       This is a good time for spiritual self-improvement and you are apt to do something about it right now. This transit changes your spiritual and religious outlook. You are more likely to rely on your own spiritual compass. Put your spiritual and religious ideals into action. This is a good time. Financial benefits come from corporate affairs.
","English"), ("TRANSASP","JUPITER","PLUTO",6,10,"TRINE",2,"       This transit gives you a more positive mental outlook. It also increases your interest in spiritual self-improvement. This may bring to the surface latent psychic abilities. It is a good time to work on furthering your education in law, science or religion.
","English"), ("TRANSASP","JUPITER","PLUTO",6,10,"SQUARED",4,"       This transit causes you to use coercive tactics to promote your religious, cultural, educational or moral agenda. You may want to engage in power plays. If you desire to control others, you will neglect your own self-improvement.
","English"), ("TRANSASP","JUPITER","PLUTO",6,10,"SEXTILE",1,"       This transit gives you a more positive mental outlook. It also increases your interest in spiritual self-improvement. This may bring to the surface latent psychic abilities. It is a good time to work on furthering your education in law, science or religion.
","English"), ("TRANSASP","JUPITER","PLUTO",6,10,"OPPOSITION",3,"       Beware of autocracy in education, spirituality, religion or morals. You can be either the perpetrator or the victim. Avoid attempts to reform others while neglecting your own development. Beware fraud. You may take on more than you can handle at this time.
","English"), ("TRANSASP","SATURN","SATURN",7,7,"CONJUNCT",0,"       This marks the end of completed professional patterns and the beginning of new ones. Serious responsibilities will arise that will require caution and maturity. You need more long term stability. Work on those long term goals. You will need to reevaluate your past actions right now. Deal with them adultly and responsibly.
","English"), ("TRANSASP","SATURN","SATURN",7,7,"TRINE",2,"       This is a good time for organization and planning in your business or professional life. This would be a good time to start, buy or merge a business or change a career. This is a good time for friendship with an older person. You can enhance your career by being involved in professional organizations.
","English"), ("TRANSASP","SATURN","SATURN",7,7,"SQUARED",4,"       This transit leaves you feeling anxious, worried, unhappy and burdened. Increased responsibilities weigh you down. You may experience unemployment or financial difficulty or legal problems. Avoid dealing with real estate. You may need to care for your parents during this time. It is possible that you may feel unpopular and rejected during this transit.
","English"), ("TRANSASP","SATURN","SATURN",7,7,"SEXTILE",1,"       This is a good time for organization and planning in your business or professional life. This would be a good time to start, buy or merge a business or change a career. This is a good time for friendship with an older person. You can enhance your career by being involved in professional organizations.       
","English"), ("TRANSASP","SATURN","SATURN",7,7,"OPPOSITION",3,"       This transit brings you a conservative business and social outlook. You conform to social norms. This is a time where marriage or a partnership may be more possible. You are aware of your responsibilities. There is a danger though of lawsuits.
","English"), ("TRANSASP","SATURN","URANUS",7,8,"CONJUNCT",0,"       This transit brings you increase responsibility for groups, friends and organizations. You may develop new friends at work and join professional organizations with an interest at modernizing your work. There is a focus on research and development. You are motivated to reach your goals. You may succeed or fail depending on your experiences or motivations. This is a good time for scientific or mathematical work, particularly involving original ideas.
","English"), ("TRANSASP","SATURN","URANUS",7,8,"TRINE",2,"       During This transit you will probably become more involved with serious friendships, groups and organizations and you will take on responsibility in them. This is a good time for a friendship with mature, serious minded, educated individuals. You work toward your humanitarian goals practically.
","English"), ("TRANSASP","SATURN","URANUS",7,8,"SQUARED",4,"       This transit puts obstacles in the way to your practical applications of your creative ideas. You may face difficulties, reversals of fortune during this transit, particularly if your motives have been selfish. This is not a good time to join groups or make friends. Problems with lawsuits may arise.
       There are possibly health problems during this transit such as broken bones, circulation problems, dental problems, skin irritations and nervous disorders.
","English"), ("TRANSASP","SATURN","URANUS",7,8,"SEXTILE",1,"       During This transit you will probably become more involved with serious friendships, groups and organizations and you will take on responsibility in them. This is a good time for a friendship with mature, serious minded, educated individuals. You work toward your humanitarian goals practically.
","English"), ("TRANSASP","SATURN","URANUS",7,8,"OPPOSITION",3,"       This transit brings you inconsistent attitudes around personal freedom and your responsibilities. You may rebel against authority but still expect obedience and compliance to your own wishes. There is conflict between the old way and the new way. Family responsibilities burden you. Beware ulterior motives. This is not a good time to deal in areas of corporate finance, insurance, taxes or the dead. Lawsuits are a risk.
","English"), ("TRANSASP","SATURN","NEPTUNE",7,9,"CONJUNCT",0,"       This transit gives you steady concentration with a psychological focus. This is a good time to meditate. This is also a good time for business dealings particularly related to art, music, entertainment or hospitals, institutions or cultural institutions. You may become depressed because of subconscious memories of unpleasant circumstances. You need to reevaluate your relationships, business and personal at this time.
","English"), ("TRANSASP","SATURN","NEPTUNE",7,9,"TRINE",2,"       This is a good transit to explore your subconscious, your psyche, your memory. Use these insights to improve the present. This is a good time to use meditation and visualization. Use your past experiences to improve your present.
","English"), ("TRANSASP","SATURN","NEPTUNE",7,9,"SQUARED",4,"       This transit brings you phobias, irrational fears and anxieties. You may try to avoid your responsibilities and work. Psychological problems of one you love may effect your performance. You may be in a real negative emotional state. This transit is associated with mental illness such as depression, paranoia. Beware secret enemies and secrets.
","English"), ("TRANSASP","SATURN","NEPTUNE",7,9,"SEXTILE",1,"       This is a good transit to explore your subconscious, your psyche, your memory. Use these insights to improve the present. This is a good time to use meditation and visualization. Use your past experiences to improve your present.
","English"), ("TRANSASP","SATURN","NEPTUNE",7,9,"OPPOSITION",3,"       This transit can bring depression. You may feel lonely and insecure. You may have painful memories from the past. Beware self-pity. You may lack self-discipline. There is a risk of mental illness. Beware Misusing drugs and alcohol. There is a risk from dishonesty. This is not a good time to deal with hospitals, religious or cultural institutions.
","English"), ("TRANSASP","SATURN","PLUTO",7,10,"CONJUNCT",0,"       This transit may bring you professional responsibilities of far reaching consequences. This can increase your will power and help you focus. This transit helps bring to an end old experiences particularly professional or political. This is a good time for self-improvement, occult study and meditation. There is some risk of paranoia or feelings of danger to deal with.
","English"), ("TRANSASP","SATURN","PLUTO",7,10,"TRINE",2,"       This is a good time to concentrate and study. You are able to concentrate right now. It's a good time to work on areas of math, science, law or the occult. Hard work will benefit your career right now.
","English"), ("TRANSASP","SATURN","PLUTO",7,10,"SQUARED",4,"       This transit brings you hard unsympathetic, poor circumstances and attitudes. You may have to deal with difficult, sinister circumstances. Beware being blackmailed or coerced in your professional life. Struggle against corruption. This transit may bring sexual problems and paranoia.
","English"), ("TRANSASP","SATURN","PLUTO",7,10,"SEXTILE",1,"       This is a good time to concentrate and study. You are able to concentrate right now. It's a good time to work on areas of math, science, law or the occult. Hard work will benefit your career right now.
","English"), ("TRANSASP","SATURN","PLUTO",7,10,"OPPOSITION",3,"       You try to force people you have relationships with to conform to your wishes. There is the risk of authoritarianism, blackmail, coercion and power struggles. Business, professional and personal relationships may end during this transit. Beware occult practices. Don't misuse them.
","English"), ("TRANSASP","URANUS","URANUS",8,8,"CONJUNCT",0,"       This transit causes you to detach from material things and release yourself from mundane responsibilities. You may develop an interest in scientific, occult or mystical subjects.
","English"), ("TRANSASP","URANUS","URANUS",8,8,"TRINE",2,"       This transit brings makes you open to new ideas, information and helps communication. This is a good time to work on your goals. You may become interested in helping humanitarian groups, or become interested in scientific or occult subjects at this time.
","English"), ("TRANSASP","URANUS","URANUS",8,8,"SQUARED",4,"       This transit makes you want to be free of external authority. You may want to break free of family ties or professional responsibilities or group ties at this time. Don't leave a mess of unfinished business behind you. This transit may force changes that may make you insecure and ill at ease. Usually you are faced with finding your own purpose to life.
","English"), ("TRANSASP","URANUS","URANUS",8,8,"SEXTILE",1,"       This transit brings makes you open to new ideas, information and helps communication. This is a good time to work on your goals. You may become interested in helping humanitarian groups, or become interested in scientific or occult subjects at this time.
","English"), ("TRANSASP","URANUS","URANUS",8,8,"OPPOSITION",3,"       This transit brings about erratic behavior. You may want freedom at any cost. This may hurt friendships, group affiliations and marriages. This may bring about a period of instability in business and financial affairs.
","English"), ("TRANSASP","URANUS","NEPTUNE",8,9,"CONJUNCT",0,"       This transit intensifies your intuitive abilities and perceptions. You may be confronted by your subconscious mind during this transit as well. You may be involved with secret groups and may have an interest in occult subjects. This transit brings about sudden changes in your life sometimes as a result of large scale events beyond your control. 
","English"), ("TRANSASP","URANUS","NEPTUNE",8,9,"TRINE",2,"       This transit stimulates your intuitive abilities and brings insights into the workings of your subconscious mind. This transit may awaken latent psychic abilities. You may develop an interest in occult subjects. This time will bring you opportunities for inner spiritual growth and development. You may receive a gift or inheritance during this transit.
","English"), ("TRANSASP","URANUS","NEPTUNE",8,9,"SQUARED",4,"       This transit brings you unproductive fantasies and psychological or psychic confusion. You may want to escape from your normal responsibilities. This is not a good time to experiment with the occult or psychic matters. This transit may bring subconscious forces to the surface. There is a danger of drugs, alcohol or mental illness at this time. Beware of cults.
","English"), ("TRANSASP","URANUS","NEPTUNE",8,9,"SEXTILE",1,"       This transit stimulates your intuitive abilities and brings insights into the workings of your subconscious mind. This transit may awaken latent psychic abilities. You may develop an interest in occult subjects. This time will bring you opportunities for inner spiritual growth and development. You may receive a gift or inheritance during this transit.
","English"), ("TRANSASP","URANUS","NEPTUNE",8,9,"OPPOSITION",3,"       This transit may cause erratic behavior that is motivated by your subconscious. You may experience unpleasant dreams or psychic experiences. Try to develop a broader and more universal outlook and be willing to change. Beware of drugs and alcohol. Don't misuse psychic practices. Your personal life may be disrupted by larger scale events beyond your control. You may be thrust into strange circumstances that you will have to deal with. There is danger from friends and groups at this time.
","English"), ("TRANSASP","URANUS","PLUTO",8,10,"CONJUNCT",0,"       This transit increases your will power. You may have a strong desire to change or improve current circumstances. Beware a desire for revolution or anarchy. Reality may come crashing down upon you during this transit You are likely to end old friendships and old relationships and start new ones. This transit can bring about in extreme circumstances drastic change including war, poverty and disaster. 
","English"), ("TRANSASP","URANUS","PLUTO",8,10,"TRINE",2,"       This transit stimulates your self-reliance and resourcefulness. This can bring about a new understanding of life which can help you make changes in your life. You become interested in and more aware of occult and metaphysical laws at this time. You may want to improve or change conditions in social institutions at this time.
","English"), ("TRANSASP","URANUS","PLUTO",8,10,"SQUARED",4,"       This transit brings revolutionary sentiments to the surface. You may want to make big changes. This is not a good time to initiate changes. Your life may be changes by forces out of your control, which you will need to adjust. This is not a good time for occult or psychic experimentation. You may end friendships or relationships at this time and people may die suddenly. There is also the danger of unexpected financial loss. Beware corporate interests and power structures.
","English"), ("TRANSASP","URANUS","PLUTO",8,10,"SEXTILE",1,"       This transit stimulates your self-reliance and resourcefulness. This can bring about a new understanding of life which can help you make changes in your life. You become interested in and more aware of occult and metaphysical laws at this time. You may want to improve or change conditions in social institutions at this time.
