","English"), ("CMTRANSASP","JUPITER","JUPITER",6,6,"OPPOSITION",3,"       This transit leaves you gullible and insincere, susceptible to deception. You are likely to have false optimism and tend to over expansion and extravagance. You take too much for granted in your relationships. Disagreements will arise over religion, education, moral, philosophical, and cultural attitudes.
","English"), ("CMTRANSASP","JUPITER","SATURN",6,7,"CONJUNCT",0,"       You are industrious with a serious minded attitude. You are purposeful, concerned with long term goals during this aspect. Combine growth with wise management. Be careful how you grow. Consider your own personal philosophy and try to honor it when possible. Your past actions can bring fruit right now. 
","English"), ("CMTRANSASP","JUPITER","SATURN",6,7,"TRINE",2,"       This is a good transit for furthering work at long term goals. You can use this transit for furthering higher education and your professional career. You will need to be honest in business and balance optimism and caution at this time. This is a good time for friendships with mature individuals.
","English"), ("CMTRANSASP","JUPITER","SATURN",6,7,"SQUARED",4,"       This transit gives you problems with your legal and business professional problems. Beware of timing on changes. It is not a good time to initiate changes. You may have conflicts between your professional and family  responsibilities. Beware of ethical conflicts.
