","English"), ("CMTRANSASP","JUPITER","SATURN",6,7,"OPPOSITION",3,"       This transit causes poor timing in business, professional, and domestic affairs. Your tactics may be questionable. This suggests legal difficulties and lawsuits. This is a bad time for expansion. Learn to be more conservative right now.
","English"), ("CMTRANSASP","JUPITER","URANUS",6,8,"CONJUNCT",0,"       You are tolerant of many different attitudes and points of view right now.  You may have sudden financial gain right now. You are able to access your latent psychic abilities right now. This is a good time to travel and pursue higher level education right now. You have strong humanitarian desires right now, use them.
