","English"), ("CMTRANSASP","JUPITER","URANUS",6,8,"SQUARED",4,"       This transit causes you to be too optimistic, impatient, disorganized, undisciplined, impractical, and lack common sense. Be careful not to jump to conclusions and take to much for granted. Watch your desire for freedom and travel which are not useful. Beware of difficulties with travel and foreigners.
       You may become involved with extreme religious characters or have problems with lawsuits and get rich schemes. You stand to lose big.
