","English"), ("CMTRANSASP","JUPITER","URANUS",6,8,"OPPOSITION",3,"       This transit causes you to be impractical and lack discipline, and make promises you cannot keep. You tend to be undisciplined, insincere and dishonest. You make promises to groups and friends that will be difficult to fulfill. Beware of cults and dubious spiritual leaders. Beware of get rich quick schemes. Your friends may be well-meaning but unreliable and eccentric.
","English"), ("CMTRANSASP","JUPITER","NEPTUNE",6,9,"CONJUNCT",0,"       You have an increased spiritual awareness right now. Expand your spiritual awareness and use it for your better good. Spread it out and do some good with it. Help mankind with your good will. Beware to balance your idealism and passion with mental objectivity and practicality.
