","English"), ("CMTRANSASP","JUPITER","NEPTUNE",6,9,"SQUARED",4,"       This transit causes you to daydream impractical dreams. Watch your tendencies to have unrealistic expectations and misplaced sympathies. Watch out for extreme religious characters and charlatans. Beware of cults and gurus. Beware of get rich quick schemes. You are very susceptible at this time.
","English"), ("CMTRANSASP","JUPITER","NEPTUNE",6,9,"SEXTILE",1,"       This is a transit that increases your spiritual awareness and increases your faith. This is a good time to be involved with mystical and spiritual groups. This is a good time for work with hospitals, institutions, or spiritual retreats. This transit also increases your humanitarian  feelings and idealism.
