","English"), ("CMTRANSASP","SATURN","SATURN",7,7,"CONJUNCT",0,"       This marks the end of completed professional patterns and the beginning of new ones. Serious responsibilities will arise that will require caution and maturity. You need more long term stability. Work on those long term goals. You will need to reevaluate your past actions right now. Deal with them adultly and responsibly.
