","English"), ("CMTRANSASP","SATURN","URANUS",7,8,"OPPOSITION",3,"       This transit brings you inconsistent attitudes around personal freedom and your responsibilities. You may rebel against authority but still expect obedience and compliance to your own wishes. There is conflict between the old way and the new way. Family responsibilities burden you. Beware ulterior motives. This is not a good time to deal in areas of corporate finance, insurance, taxes or the dead. Lawsuits are a risk.
