","English"), ("CMTRANSASP","SATURN","NEPTUNE",7,9,"SQUARED",4,"       This transit brings you phobias, irrational fears and anxieties. You may try to avoid your responsibilities and work. Psychological problems of one you love may effect your performance. You may be in a real negative emotional state. This transit is associated with mental illness such as depression, paranoia. Beware secret enemies and secrets.
