","English"), ("CMTRANSASP","SATURN","NEPTUNE",7,9,"OPPOSITION",3,"       This transit can bring depression. You may feel lonely and insecure. You may have painful memories from the past. Beware self-pity. You may lack self-discipline. There is a risk of mental illness. Beware Misusing drugs and alcohol. There is a risk from dishonesty. This is not a good time to deal with hospitals, religious or cultural institutions.
