","English"), ("CMTRANSASP","SATURN","PLUTO",7,10,"OPPOSITION",3,"       You try to force people you have relationships with to conform to your wishes. There is the risk of authoritarianism, blackmail, coercion and power struggles. Business, professional and personal relationships may end during this transit. Beware occult practices. Don't misuse them.
