","English"), ("CMTRANSASP","URANUS","NEPTUNE",8,9,"OPPOSITION",3,"       This transit may cause erratic behavior that is motivated by your subconscious. You may experience unpleasant dreams or psychic experiences. Try to develop a broader and more universal outlook and be willing to change. Beware of drugs and alcohol. Don't misuse psychic practices. Your personal life may be disrupted by larger scale events beyond your control. You may be thrust into strange circumstances that you will have to deal with. There is danger from friends and groups at this time.
","English"), ("CMTRANSASP","URANUS","PLUTO",8,10,"CONJUNCT",0,"       This transit increases your will power. You may have a strong desire to change or improve current circumstances. Beware a desire for revolution or anarchy. Reality may come crashing down upon you during this transit You are likely to end old friendships and old relationships and start new ones. This transit can bring about in extreme circumstances drastic change including war, poverty and disaster. 
