","English"), ("CMTRANSASP","URANUS","PLUTO",8,10,"SQUARED",4,"       This transit brings revolutionary sentiments to the surface. You may want to make big changes. This is not a good time to initiate changes. Your life may be changes by forces out of your control, which you will need to adjust. This is not a good time for occult or psychic experimentation. You may end friendships or relationships at this time and people may die suddenly. There is also the danger of unexpected financial loss. Beware corporate interests and power structures.
