","English"), ("CMTRANSASP","URANUS","PLUTO",8,10,"OPPOSITION",3,"       This transit may bring about your elimination of old and useless conditions in your life and you may make drastic changes. You may need to rethink your goals at this time, and this transit may bring new awarenesses. You may develop revolutionary sentiments and a desire to overthrow. Your normal affairs may be disrupted by events beyond your control. Old friendships and group affiliations may end and new ones may start. Psychic experimentation is not safe at this time. There is the danger of power struggles at this time.
