","English"), ("CMTRANSASP","NEPTUNE","NEPTUNE",9,9,"OPPOSITION",3,"       This transit causes you to need to develop a spiritual serenity. You may feel the need to withdraw from worldly affairs and you may become dependent on your family.
","English"), ("CMTRANSASP","NEPTUNE","PLUTO",9,10,"CONJUNCT",0,"       This transit causes you to explore your subconscious mind. You may experience some miraculous or supernatural occurrences during this transit. This transit may awaken latent psychic abilities in you. This is a good transit for occult or paranormal activities. This transit causes your subconscious mind to reorganize and you let go of old negative attitudes. Large scale events beyond your control can affect your life profoundly.
